caption.text:
"Susah dan senang, jatuh dan bangun, gembira dan terluka, aku bersamamu.
Aku bersamamu untuk menuntun, bukan menuntut; 
menggandeng, bukan menarik paksa;
mempercayai, bukan mencuriga;
membahagiakan, bukan membahayakan. 
Jadi, jangan menyerah... jangan hari ini.

Tidak perlu bersama selamanya, selamanya itu terlalu lama. Seumur hidup saja. Untukku, itu sudah lebih dari cukup." Fiersa Besari, 2016:69
